import React from 'react'


export default class BabysitterInput extends React.Component {

    state = {
        first_name: '',
        last_name: '',
        phone_number: ''
    }

    render() {
        return(
            <div>
                <form >
                    <label>First Name: </label>
                    <input type="text" placeholder="First Name" value={this.state.first_name} />
                    <br/><br/>
                    <label>Last Name: </label>
                    <input type="text" placeholder="Last Name" value={this.state.last_name}/>
                    <br/><br/>
                    <label>Phone Number: </label>
                    <input type="text" placeholder="Phone Number" value={this.state.phone_number}/>
                </form>
            </div>
        )
    }
}
